import React from 'react';
import ReactDOM from 'react-dom';
import App from './App'; // Import your main component

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root') // This is where your app will be rendered in the HTML file
);
